const grouped = {};

// Helper function to parse "DD-MM-YYYY HH:mm:ss" into JS Date
function parseDate(dateStr) {
  if (!dateStr) return null; // safeguard
  const [day, month, rest] = dateStr.split("-");
  if (!rest) return null;
  const [year, time] = rest.split(" ");
  return new Date(`${year}-${month}-${day}T${time}`);
}

// Helper to normalize phone number (remove +91 if present)
function normalizePhone(phone) {
  if (!phone) return null;
  phone = String(phone).trim(); // force to string
  return phone.replace(/^(\+91)/, "").trim();
}

// Group orders by billing_phone
for (const row of items) {
  const phone = normalizePhone(row.json.billing_phone);
  if (!phone) continue; // skip if phone missing

  if (!grouped[phone]) {
    grouped[phone] = {
      billing_phone: phone,
      customer_email: row.json.customer_email,
      name: row.json.billing_first_name + " " + row.json.billing_last_name,
      orders: []
    };
  }

  // add order
  grouped[phone].orders.push(parseDate(row.json.order_date));
}

// Sort orders for each customer
return Object.values(grouped).map(cust => {
  cust.orders = cust.orders.filter(o => o !== null).sort((a, b) => a - b);
  return { json: cust };
});

// Predict next order based on average gap
function predictNextOrder(orders = []) {
  if (!Array.isArray(orders)) return null;

  // Remove nulls and invalid dates
  const validOrders = orders
    .map(d => d ? new Date(d) : null)
    .filter(d => d instanceof Date && !isNaN(d));

  // Need at least 2 orders to calculate a gap
  if (validOrders.length < 2) {
    return null;
  }

  // Sort orders ascending
  validOrders.sort((a, b) => a - b);

  // Calculate gaps in days
  const gaps = [];
  for (let i = 1; i < validOrders.length; i++) {
    const diffDays = (validOrders[i] - validOrders[i - 1]) / (1000 * 60 * 60 * 24);
    gaps.push(diffDays);
  }

  // Average gap
  const avgGap = gaps.reduce((a, b) => a + b, 0) / gaps.length;

  // Next order = last order + avg gap
  const lastOrder = validOrders[validOrders.length - 1];
  const nextOrder = new Date(lastOrder);
  nextOrder.setDate(lastOrder.getDate() + Math.round(avgGap));

  return nextOrder;
}

// Loop through all customers in data[]
return items[0].json.data.map(cust => {
  const predictedDate = predictNextOrder(cust.orders);

  return {
    json: {
      billing_phone: cust.billing_phone,
      customer_email: cust.customer_email,
      name: cust.name,
      orders: cust.orders,
      predicted_next_order: predictedDate ? predictedDate.toISOString() : "Not enough data"
    }
  };
});

// Input: already grouped customers with orders array
let customers = $input.all().map(item => item.json);

// Keep only customers with valid 10-digit billing_phone
customers = customers.filter(c => {
  // Check: not null/empty, only digits, length = 10
  return c.billing_phone && /^\d{10}$/.test(c.billing_phone);
});

// Separate into repeat vs one-time
const repeatCustomers = customers.filter(c => c.orders && c.orders.length > 1);
//const oneTimeCustomers = customers.filter(c => c.orders && c.orders.length === 1);

// Return both lists (or whichever you need)
return [
  { json: { data: repeatCustomers } }
  //{ json: { data: oneTimeCustomers } }
];
